import React from "react";
import Col from "react-bootstrap/Col"


function AboutMain() {
    return (
      <main>
          <Col md={{ span: 4, offset: 4 }}>{`md={{ span: 4, offset: 4 }}`}</Col>
      </main>
    )
}

export default AboutMain
